import React from 'react';

const PhotoSet = ({project}) => {
  return (
    <div className="PhotoSet">
      <a href={project.link}>
        <h2>
          {project.title}
        </h2>
      </a>
      <p>{project.description}</p>
    </div>
  );
}

export default PhotoSet;
